  `disposable_cycle` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '抛弃',
  `disposable_cycle_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '抛弃名称',
  `is_overseas_product` tinyint(4) NULL DEFAULT NULL COMMENT '是否海淘商品',
  `operation` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品经营属性',
  `operation_name` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品经营属性名称',
  `supplier_name` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品供应商',
  `is_stop` tinyint(1) NULL DEFAULT NULL COMMENT '是否停采',
  `is_oem` tinyint(1) NULL DEFAULT NULL COMMENT '是否oem品',
  `is_new` tinyint(1) NULL DEFAULT NULL COMMENT '是否新品',
  `delete_flag` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否删除（0：未删除，1：已删除）',
  `brand_active` tinyint(1) NULL DEFAULT NULL,
