  `type_name` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品类型名称',
  `material_id` varchar(0) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '材质id',
  `material_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '材质类型',
  `specs` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '规格',
  `is_astigmia` tinyint(4) NULL DEFAULT NULL COMMENT '是否散光',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_pt_product_code`(`product_code`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 9049 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品维表' ROW_FORMAT = Dynamic;

